Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 4136/86 of 22 December 1986 on common rules for imports of certain textile products originating in third countries (1), as last amended by Regulation (EEC) No 718/89 (2), and in particular Article 17 thereof,
Whereas, with a view to the introduction of the combined nomenclature, the Community has negotiated with Pakistan an Agreed Minute modifying the quantitative limit for category 4 products provided for in the Agreement between the EEC and Pakistan on trade in textiles;
Whereas the Council has decided, on 24 July 1989, that this Agreed Minute should be applied provisionally pending its formal conclusion;
Whereas it is therefore necessary to amend Annexes III and IV bis to Regulation (EEC) No 4136/86;
